import { combineReducers } from "redux";
import storageSession from "redux-persist/lib/storage/session";

import user from "./user";

const persistConfig = {
  key: "root",
  storageSession,
  whitelist: ["auth"],
};

const rootReducer = combineReducers({
  user,
});

export default rootReducer;
